import React, { useEffect, useState } from "react";
import { getTeams } from "../../api/api";
export default function Teams() {
  const [teams, setTeams] = useState();
  useEffect(() => {
    getTeams()
      .then(res => {
        return res.json();
      })
      .then(data => {
        setTeams(data.data);
      })
      .catch(error => console.error(error));
  }, []);
  const arr = teams.map(team => {
    return <li>{team}</li>;
  });

  return (
    <div>
      <ul>{arr}</ul>
    </div>
  );
}
